int frame = 0;


// ---------------- Variables ----------------
bool crossingActive = false;
unsigned long crossStart = 0;
int crossDuration = 0;

long readDistanceCM() {
  digitalWrite(trigPin, LOW);
  delayMicroseconds(2);
  digitalWrite(trigPin, HIGH);
  delayMicroseconds(10);
  digitalWrite(trigPin, LOW);
  long duration = pulseIn(echoPin, HIGH, 30000); // timeout 30ms
  return duration * 0.034 / 2;
}

void setup() {
  Serial.begin(9600);

  pinMode(buttonPin, INPUT_PULLUP);
  pinMode(ldrPin, INPUT);
  pinMode(trigPin, OUTPUT);
  pinMode(echoPin, INPUT);

  pinMode(greenPin, OUTPUT);
  pinMode(yellowPin, OUTPUT);
  pinMode(redPin, OUTPUT);

  // เริ่มไฟปกติเป็นไฟเขียว
  digitalWrite(greenPin, HIGH);
  digitalWrite(yellowPin, LOW);
  digitalWrite(redPin, LOW);

  // OLED
  Wire.begin();
  if(!display.begin(SSD1306_SWITCHCAPVCC, 0x3C)) {
    Serial.println(F("SSD1306 init failed"));
    for(;;);
  }
  display.clearDisplay();
  display.setTextSize(2);
  display.setTextColor(SSD1306_WHITE);
  // Draw a simple car shape on the OLED
  display.clearDisplay();
  display.setCursor(20, 10);
  display.println("Traffic");
  display.drawBitmap(32, 15, carframes[frame], FRAME_WIDTH, FRAME_HEIGHT, 1);
  display.display();
  frame = (frame + 1) % FRAME_COUNT2;
  delay(FRAME_DELAY);

  Serial.println("Setup done");
  delay(1000);
}

void loop() {
  int buttonState = digitalRead(buttonPin);
  long distance = readDistanceCM();
  int ldrValue = analogRead(ldrPin);

  // ถ้ามีการกดปุ่ม และไม่มีรถใกล้ และยังไม่อยู่ในโหมดข้าม
  Serial.printf("%d %d %d\n", buttonState, distance, ldrValue);
  delay(100);
  if (buttonState == LOW && !crossingActive) {

    // If there are cars
    if (distance < 10){
      globalTime = 45;           // เวลาไฟเหลือง 3 วิ
    }
    // otherwise....
    else{
      globalTime = 3;
    }

    // เปิดไฟgreenและนับถอยหลัง แล้วแต่เวลาที่ตั้งไว้
    digitalWrite(greenPin, HIGH);
    for (int i = globalTime; i > 0; i--) {
      display.clearDisplay();
      display.setCursor(10, 20);
      display.print(i);
      display.drawBitmap(32, 0, carframes[frame], FRAME_WIDTH, FRAME_HEIGHT, 1);
      display.display();
      frame = (frame + 1) % FRAME_COUNT2;
      delay(FRAME_DELAY);
      delay(1000);
    }
    digitalWrite(greenPin, LOW);

    // เปิดไฟเหลืองและนับถอยหลัง 3 วิ
    digitalWrite(greenPin, LOW);
    digitalWrite(yellowPin, HIGH);
    for (int i = 3; i > 0; i--) {
      display.clearDisplay();
      display.setTextSize(2);
      display.setCursor(10, 20);
      display.print(i);
      display.drawBitmap(32, 0, warningframes[frame], FRAME_WIDTH, FRAME_HEIGHT, 1);
      display.display();
      frame = (frame + 1) % FRAME_COUNT3;
      delay(FRAME_DELAY);
      delay(1000);
    }
    digitalWrite(yellowPin, LOW);

    // เปลี่ยนเป็นไฟแดง
    digitalWrite(redPin, HIGH);

    // กำหนดเวลาให้คนข้าม
    if (ldrValue < ldrThreshold) {
      crossDuration = crossNightTime;  // กลางคืน
    } 
    else {
      crossDuration = crossDayTime;    // กลางวัน
    }

    crossingActive = true;
    crossStart = millis();
  }

  // ถ้าอยู่ในโหมดข้าม
  if (crossingActive) {
    unsigned long elapsed = (millis() - crossStart) / 1000;
    int remaining = crossDuration - elapsed;

    // แสดงเวลานับถอยหลังบน OLED
    display.clearDisplay();
    display.setTextSize(2);
    display.setCursor(10, 20);
    display.print(remaining);
    display.drawBitmap(32, 0, walkframes[frame], FRAME_WIDTH, FRAME_HEIGHT, 1);
    display.display();
    frame = (frame + 1) % FRAME_COUNT1;
    delay(FRAME_DELAY);
    
    

    if (remaining <= 0) {
      // จบโหมดข้าม
      crossingActive = false;

      // เปลี่ยนกลับเป็นไฟเขียว
      digitalWrite(redPin, LOW);
      digitalWrite(greenPin, HIGH);
      display.clearDisplay();
      display.drawBitmap(32, 0, carframes[frame], FRAME_WIDTH, FRAME_HEIGHT, 1);
      display.display();
      frame = (frame + 1) % FRAME_COUNT2;
      delay(FRAME_DELAY);
    }
  }
}
